import Layout from "../components/Layout"
const CheckoutView = () => {
    return (
        <Layout title="Checkout" description="">
            <section className="py-5">
                <div className="container">
                    <h2>Checkout View Content</h2>
                </div>
            </section>
        </Layout>
    )
}

export default CheckoutView;
